import React from 'react';

const Terms = () => {
  return (
    <div className="terms-container">
      <h1>Terms and Conditions</h1>
      <p>By booking a car rescue service, you agree to the following terms:</p>
      <ul>
        <li>Service charges will be calculated based on distance and vehicle condition.</li>
        <li>Payment will be done on-site before the service is rendered.</li>
        <li>You are responsible for providing accurate details about the vehicle condition.</li>
        {/* Add more terms as required */}
      </ul>
    </div>
  );
};

export default Terms;
